#include "Singleton.h"



bool Singleton::instanceFlag = false;
Singleton* Singleton::single = NULL;
Singleton* Singleton::getInstance()
{
    if(! instanceFlag)
    {
        single = new Singleton();
        instanceFlag = true;
        return single;
    }
    else
    {
        return single;
    }
}

void Singleton::method()
{
    cout << "Method of the singleton class" << endl;
}


float Singleton::RandomNumber(float Min, float Max)
{
    return ((float(rand()) / float(RAND_MAX)) * (Max - Min)) + Min;
}

// Main draw mesh
void Singleton::drawMesh(Mesh mesh){
    
    glBindBuffer(GL_ARRAY_BUFFER, mesh.vbo);
    glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, mesh.vinx);
    
    glActiveTexture(GL_TEXTURE0);
    glBindTexture(GL_TEXTURE_2D, mesh.texture);
    glUniform1i(_textureUniform, 0);
    
    glVertexAttribPointer(_positionSlot, 3, GL_FLOAT, GL_FALSE, sizeof(struct vertex_struct), BUFFER_OFFSET( 0 ));
    glVertexAttribPointer(_texCoordSlot, 2, GL_FLOAT, GL_FALSE, sizeof(struct vertex_struct), BUFFER_OFFSET( (sizeof(float) * 6)));
    
    glDrawElements(GL_TRIANGLES, mesh.faces_count * 3, INX_TYPE, 0);
}

void Singleton::drawMeshTexture(Mesh mesh, GLuint texture){
    
    glBindBuffer(GL_ARRAY_BUFFER, mesh.vbo);
    glBindBuffer(GL_ELEMENT_ARRAY_BUFFER, mesh.vinx);
    
    
    glActiveTexture(GL_TEXTURE0);
    glBindTexture(GL_TEXTURE_2D, texture);
    glUniform1i(_textureUniform, 0);
    
    glVertexAttribPointer(_positionSlot, 3, GL_FLOAT, GL_FALSE, sizeof(struct vertex_struct), BUFFER_OFFSET( 0 ));
    // glVertexAttribPointer(Singleton::getInstance()->_colorSlot, 4, GL_FLOAT, GL_FALSE, sizeof(Vertex), (GLvoid*) (sizeof(float) * 3));
    glVertexAttribPointer(_texCoordSlot, 2, GL_FLOAT, GL_FALSE, sizeof(struct vertex_struct), BUFFER_OFFSET( (sizeof(float) * 6)));
    
    glDrawElements(GL_TRIANGLES, mesh.faces_count * 3, INX_TYPE, 0);
}


